import React, { useRef } from "react";
import { Link, useNavigate, useLocation } from "react-router-dom";
import "./Login.css";

export default function LoginPage() {
    const usernameRef = useRef();
    const passwordRef = useRef();
    const navigate = useNavigate();
    const location = useLocation();

    // Extract the 'from' state (redirect destination) passed during navigation
    const { from } = location.state || { from: { pathname: "/dashboard" } };  // Default to dashboard if no state is passed

    const handleSignIn = () => {
        const username = usernameRef.current.value.trim();
        const password = passwordRef.current.value.trim();

        // Hardcoded user credentials for login validation (you can replace this with actual logic if needed)
        const hardcodedUser = {
            email: "user@example.com", // Example email
            password: "password123",    // Example password
        };

        // Simple validation (remove if you want no validation)
        if (username === hardcodedUser.email && password === hardcodedUser.password) {
            alert("Login successful!");
            navigate(from);  // Redirect to the page passed in the 'from' state
        } else {
            alert("Invalid username or password.");
        }
    };

    return (
        <div className="unique-login-page">
            <div className="unique-login-container">
                <div className="unique-form-container">
                    <Link to="/loginc" className="signup-link">Back</Link>
                    <h2 className="unique-form-title">Sign In</h2>
                    <form
                        className="unique-form unique-signin-form"
                        onSubmit={(e) => e.preventDefault()}
                    >
                        <div className="unique-form-group">
                            <label htmlFor="username">Username (Email)</label>
                            <input
                                className="unique-form-input"
                                type="text"
                                name="username"
                                placeholder="Enter your username"
                                ref={usernameRef}
                            />
                        </div>
                        <div className="unique-form-group">
                            <label htmlFor="password">Password</label>
                            <input
                                className="unique-form-input"
                                type="password"
                                name="password"
                                placeholder="Enter your password"
                                ref={passwordRef}
                            />
                        </div>
                        <button
                            type="button"
                            className="unique-form-submit-button"
                            onClick={handleSignIn}
                        >
                            Sign In
                        </button>
                    </form>
                    <div className="unique-signup-link">
                        <p>
                            Don't have an account? <Link to="/signup">Sign Up</Link>
                        </p>
                    </div>
                </div>
            </div>
        </div>
    );
}
